As a react native developer I want to be able to use base64 images, so that I can save on network requests for small images (such as icons).

https://facebook.github.io/react-native/docs/images#uri-data-images

Acceptance Criteria:
* User is able to use the data :uri scheme to use base64 image. 
* Supporting on all possible platforms (iOS, tvOS, Android,AndroidTV, AmazonFireTV, Roku NDK, Roku Cloud, Tizen, WebOS, UWP, PS4) -- if there are limitation we must note them.
* Updated documentation around support for the feature
{{  source={{
    uri:
      'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAADMAAAAzCAYAAAA6oTAqAAAAEXRFWHRTb2Z0d2FyZQBwbmdjcnVzaEB1SfMAAABQSURBVGje7dSxCQBACARB+2/ab8BEeQNhFi6WSYzYLYudDQYGBgYGBgYGBgYGBgYGBgZmcvDqYGBgmhivGQYGBgYGBgYGBgYGBgYGBgbmQw+P/eMrC5UTVAAAAABJRU5ErkJggg==',
  }}
/>}}

Some platforms support setting:
* *minBufferMs*: The default minimum duration of media that the player will attempt to ensure is buffered at all times, in milliseconds.
* *maxBufferMs*: The default maximum duration of media that the player will attempt to buffer, in milliseconds.
* *bufferForPlaybackMs*: The default duration of media that must be buffered for playback to start or resume following a user action such as a seek, in milliseconds.
* *playbackAfterRebufferMs*: The default duration of media that must be buffered for playback to resume after a rebuffer, in milliseconds. A rebuffer is defined to be caused by buffer depletion rather than a user action.

This prop should only be set when you are setting the source, changing it after the media is loaded will cause it to be reloaded.

Example with default values:


{code:java}
bufferConfig={{
  minBufferMs: 15000,
  maxBufferMs: 50000,
  bufferForPlaybackMs: 2500,
  bufferForPlaybackAfterRebufferMs: 5000
}}
{code}

As a React Native developer, I want to capture the Blue Sony key. In order to do so, I’d need to know that I am looking for the  {{YI_SONY_KEY_BLUE}} string or something to that effect. At the moment, the only way a developer  knows the name of that key code string is to look for it in the {{Input.js}} module and search through all of the key codes. It would be a lot more convenient if the keys were exported to a file so that something like this is possible:


{code}import { Input } from '@youi/react-native-youi';
Input.addEventListener(Input.YI_SONY_KEY_BLUE, this.handleInputEvent);{code}


*Acceptance Criteria*

* Ensure they are published in the API documentation.

According to Apple (https://developer.apple.com/macos/whats-new/)

{quote}Apps built using OpenGL and OpenCL will continue to run in macOS 10.14, but these legacy technologies are deprecated in macOS 10.14. Games and graphics-intensive apps that use OpenGL should now adopt Metal. Similarly, apps that use OpenCL for computational tasks should now adopt Metal and Metal Performance Shaders.{quote}

This epic captures the effort required to port to this graphics API.

MetadataReceived is currently available in CYICastLabsVideoPlayer through CYISignal<Metadata> MetadataReceived; 
Unfortunately, this means we can only use this feature where CYICastLabsVideoPlayer is implemented, which limits us to PS4.

We need this feature across all platforms.

Example current usage from the client:

context->metaDataReceiver = std::make_unique<MetaDataReceiver>(this);

auto castLabsPlayer = YiDynamicCast<CYICastLabsVideoPlayer>(context->videoPlayer); 
castLabsPlayer->MetadataReceived.Connect(*context->metaDataReceiver, &MetaDataReceiver::OnMetadataReceived);

Example future usage: 
context->videoPlayer->MetadataReceived.Connect(*context->metaDataReceiver, &MetaDataReceiver::OnMetadataReceived);

----- original message -----
It requires investigation from Product team to understand if "CYISignal[Metadata] MetadataReceived" can be implemented across all supported platform.
Currently known possible platforms is XBoxOne (MediaPlayer), all other platforms need to be investigated. (Required JIRA)

~* Please see Zendesk Support tab for further comments and attachments.~

As a React Native Developer, I often want to make use of nested text to accomplish specific styles on subsets of text.

For example:

import React, { Component } from 'react';
import { AppRegistry, Text } from 'react-native';


{code:java}
export default class BoldAndBeautiful extends Component {
  render() {
    return (
      <Text style={{fontWeight: 'bold'}}>
        I am bold
        <Text style={{color: 'red'}}>
          and red
        </Text>
      </Text>
    );
  }
}
{code}
 !Screen Shot 2019-06-04 at 3.15.28 PM.png|thumbnail! 

To be displayed as:
https://facebook.github.io/react-native/docs/text.html

In case of a view, RN developers expect to use something like this:
{code:java}
<View>
    <Text>
        There is a blue square
    </Text>
    <View style={{width: 50, height: 50, backgroundColor: 'steelblue'}} />
    <Text>
        in between my text.
    </Text>
</View>
{code}

*Acceptance criteria*
* RN developers are able to using nested Text and nested Views in text
* RN Supported Components spreadsheet updated with new components; external docs updated as well.

As a React Native developer, I need to listen for multiple keys being pressed, and I find it tedious to add a different listener for every key. I would like a universal key trap function that allows me to capture input from every key press.

And I would like to do this instead:

{code:javascript}
Input.addEventListener('keydown`, () => { 
case YI_KEY_ARROW_UP:
case YI_KEY_ARROW_DOWN:
  doSomething();
});
{code}

*Acceptance Criteria*
* Must include technical documentation around new usage pattern.
* Must modify existing samples to support this pattern, if applicable.
